import React, {useState } from "react";
import { createProduct, updateProduct } from "../services/products";
import { Button, Dialog, DialogTitle, DialogContent, DialogActions, Box, TextField, Typography, MenuItem, Select, FormControl, FormHelperText } from "@mui/material";
import { toast } from "react-toastify";
import * as Yup from "yup";

const ModalWrapper = ({
  isOpen,
  toggle,
  products,
  setProducts,
  selectedRow,
  // updateListingData,
}) => {
  const [name, setName] = useState(selectedRow?.name || "");
  const [price, setPrice] = useState(selectedRow?.price || "");
  const [category, setCategory] = useState(selectedRow?.category || "");
  const [description, setDescription] = useState(
    selectedRow?.description || ""
  );
  const [availabilityStatus, setAvailabilityStatus] = useState(
    selectedRow?.availabilityStatus || ""
  );
  const [validationErrors, setValidationErrors] = useState({});

  const statusArray = ["active", "inactive"];

  const validationSchema = Yup.object().shape({
    price: Yup.number().required(),
  });
  const handleEditBuilding = async () => {
  //     try {

  //       const editedBuilding = {
  //         build_id: selectedRow?.build_id,
  //         build_name: name,
  //         build_status: status,
  //       };

  //       const response = await editBuilding(editedBuilding);

  //       if (response && response.status === "success") {
  //         toast.success(t("buildings.validation.edit_msg"));
  //         updateListingData(editedBuilding);
  //         toggle();
  //       } else {
  //         toast.error(t("buildings.validation.err_edit"));
  //       }
  //     } catch (error) {
  //       if (error.name === "ValidationError") {
  //         const errors = {};
  //         error.inner.forEach((e) => {
  //           errors[e.path] = e.message;
  //         });
  //         setValidationErrors(errors);
  //       }
  //     }
    };

  const handleAddProduct = async () => {
    try {

      await validationSchema.validate(
        { price: price,},
        { abortEarly: false }
      );

      const product = {
        name: name,
        price: price,
        category: category,
        description: description,
        availability_status: availabilityStatus,
      };



      const response = await createProduct(product);
      if (response && response.status) {
        toast.success("Adding Product Succussfly");

        setName("");
        setPrice("");
        setCategory("");
        setDescription("");
        setAvailabilityStatus("");

        product.product_id = response.message.build_id;

        const _products = [...products];
        _products.unshift(product);
        setProducts(_products);
        setTimeout(() => {
          toggle();
        }, "1000");
      } else {
        toast.error("Error adding");
      }
    } catch (error) {
      console.log(error);
      
      if (error.name === "ValidationError") {
        const errors = {};
        error.inner.forEach((e) => {
          errors[e.path] = e.message;
        });

        setValidationErrors(errors);
      }
    }
  };
const handleAction = selectedRow ? handleEditBuilding : handleAddProduct;
const buttonLabel = selectedRow
  ? "Edit Product"
  : "Add Product";





  return( 
    <Dialog open={isOpen} onClose={toggle} fullWidth>
    <DialogTitle>{buttonLabel}</DialogTitle>
    
    <DialogContent>
      <Box component="form" noValidate autoComplete="off">
        <FormControl fullWidth margin="normal" >
          <Typography variant="subtitle1">{"Name of product"}</Typography>
          <TextField
            variant="outlined"
            id="name"
            // placeholder="name of product"
            value={name}
            onChange={(e) => setName(e.target.value)}
          />
        </FormControl>

        <FormControl fullWidth margin="normal" >
          <Typography variant="subtitle1">{"Price of product"}</Typography>
          <TextField
            variant="outlined"
            id="price"
            // placeholder="price of product"
            value={price}
            onChange={(e) => setPrice(e.target.value)}
            // helperText={!price && validationErrors.price}
          />
           <FormHelperText>{ validationErrors.price}</FormHelperText>
        </FormControl>

        <FormControl fullWidth margin="normal" >
          <Typography variant="subtitle1">{"Category of product"}</Typography>
          <TextField
            variant="outlined"
            id="category"
            // placeholder="category of product"
            value={category}
            onChange={(e) => setCategory(e.target.value)}
          />
          
        </FormControl>

        <FormControl fullWidth margin="normal" >
          <Typography variant="subtitle1">{"Description of product"}</Typography>
          <TextField
            variant="outlined"
            id="description"
            // placeholder="description of product"
            value={description}
            onChange={(e) => setDescription(e.target.value)}
          />
        </FormControl>

        {/* <FormControl fullWidth margin="normal" >
          <Typography variant="subtitle1">{"Availability Status of product"}</Typography>
          <TextField
            variant="outlined"
            id="availabilityStatus"
            // placeholder="availabilityStatus of product"
            value={availabilityStatus}
            onChange={(e) => setAvailabilityStatus(e.target.value)}
          />
        </FormControl> */}

<FormControl fullWidth margin="normal" >
            <Typography variant="subtitle1">{"Availability Status of product"}</Typography>
            <Select
              variant="outlined"
              value={availabilityStatus}
              onChange={(e) => setAvailabilityStatus(e.target.value)}
            >
              {statusArray.map((item, index) => (
                <MenuItem key={`product-status-${index}`} value={item}>
                  {item}
                </MenuItem>
              ))}
            </Select>
            {/* <FormHelperText>{!status && validationErrors.status}</FormHelperText> */}
          </FormControl>
      </Box>
    </DialogContent>
    
    <DialogActions>
      <Button variant="contained" color="primary" onClick={handleAction}>
        {buttonLabel}
      </Button>
      <Button variant="contained" color="secondary" onClick={toggle}>
        {"Cancel"}
      </Button>
    </DialogActions>
  </Dialog>
    );
};

export default ModalWrapper;
